import styled from 'styled-components';
const Category = ({ categoryList }) => {
  const categoryContentList = categoryList.map((key) => (
    <CategoryContent>{key}</CategoryContent>
  ));
  return <div>{categoryContentList}</div>;
};
export default Category;

const CategoryContent = styled.div`
  width: 180px;
  margin: 5px;
  padding: 5px;
  border-radius: 3px;
  background-color: rgba(10, 10, 35, 0.8);
`;
